import './App.css';
import Appbar from './components/Appbar';
import Data from './components/Data';
import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Result from './components/Result.js';
import Details from './components/Details.js';
import View from './components/View.js';
import Edit from './components/Edit.js';
import Login from './components/Login';
import { AuthProvider } from './context/AuthProvider';

class App extends Component {
  render() {
    const myStyle = {
      backgroundImage:
        "url('https://th.bing.com/th/id/R.6f4dd59bf1f5794913c6b0e0f096bf7e?rik=G%2fMZr4l4WxrW%2fw&riu=http%3a%2f%2fi.stack.imgur.com%2f7YKUD.jpg&ehk=oWZpgjcwS0B7wkTMEuTHEawpHqIHFSqjVRcMfKQEwd0%3d&risl=&pid=ImgRaw&r=0')",
      backgroundSize: 'cover',
      minHeight: "100vh",
      backgroundRepeat: 'repeat',
    }
    return (
      <Router>
        <div>
          <Routes>
            <Route exact path='/' element={
              <div className="App" style={myStyle}>
                <Appbar />
                <Data style={{ margin: '3em' }} />
              </div>
            } />
            <Route exact path='/login' element={<AuthProvider>
              <Login />
            </AuthProvider>} />
            <Route exact path='/result' element={<AuthProvider>
              <Result />
            </AuthProvider>} />
            <Route exact path='/details/:id' element={<Details />} />
            <Route exact path='/view/:id' element={<View />} />
            <Route exact path='update/:id' element={<Edit />} />
          </Routes>
        </div>
      </Router>
    );
  }
}
export default App;
